// Translation dictionaries for different locales
const translations = {
    en: translations_en,
    de: translations_de,
    es: translations_es,
    fr: translations_fr,
    he: translations_he,
    ja: translations_ja,
    ko: translations_ko,
    pt: translations_pt,
    zh_CN: translations_zh_CN,
    zh_TW: translations_zh_TW,
};

function processTranslations(locale, translations) {
    const fileName = `messages.${locale}.xlf`;

    fs.readFile('messages.xlf', 'utf8', (err, data) => {
        if (err) {
            console.error(`Error reading the XLIFF file for ${locale}:`, err);
            return;
        }

        xml2js.parseString(data, (err, result) => {
            if (err) {
                console.error(`Error parsing the XLIFF file for ${locale}:`, err);
                return;
            }

            const transUnits = result.xliff.file[0].body[0]['trans-unit'];
            transUnits.forEach(unit => {
                const sourceText = unit.source[0];
                if (translations[sourceText]) {
                    unit.target = [translations[sourceText]];
                } else {
                    if (!unit.target) {
                        unit.target = [''];
                    }
                }

                const sourceIndex = unit.source[0]['_index'];
                unit.target[0]['_index'] = sourceIndex + 1;
            });

            const builder = new xml2js.Builder();
            const updatedXML = builder.buildObject(result);

            fs.writeFile(fileName, updatedXML, (err) => {
                if (err) {
                    console.error(`Error writing the updated XLIFF file for ${locale}:`, err);
                    return;
                }
                console.log(`XLIFF file for ${locale} updated successfully.`);
            });
        });
    });
}

Object.keys(translations).forEach(locale => {
    processTranslations(locale, translations[locale]);
});
